import React from 'react';
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtnLink,
} from './NavBarElements';

export default function Navbar (props) {

  const {user} = props;

  return (
    <>
      <Nav>
        {/* <NavLink to='/'> */}
          {/* <img src={require('../../images/logo.svg')} alt='logo' /> */}
        {/* </NavLink> */}
        <Bars />
        <NavMenu>
          <h1 style={{color:'white', fontWeight:'bold'}}><h1>Inventory Management System</h1> </h1>
          <NavLink to='/supplier' activeStyle>
            Suppliers
          </NavLink>
          <NavLink to='/customer' activeStyle>
            Customers
          </NavLink>
          <NavLink to='/item' activeStyle>
            Items
          </NavLink>
          <NavLink to='/stock' activeStyle>
            Stocks
          </NavLink>
          <NavLink to='/invoice' activeStyle>
            Invoices
          </NavLink>
          <NavLink to='/user' activeStyle>
            {
            user ? user.level == 'admin' ? 'Users' : 'Profile' : null
            }
          </NavLink>
          {/* Second Nav */}
          <NavBtnLink to='/logout'>Logout</NavBtnLink>
        </NavMenu>

      </Nav>
    </>
  );
};
